pub struct VimName {
    pub name: &'static str,
    hex: u32,
}

impl VimName {
    pub fn rgb(&self) -> (u8, u8, u8) {
        let r = ((self.hex >> 16) & 0xff) as u8;
        let g = ((self.hex >> 8) & 0xff) as u8;
        let b = (self.hex & 0xff) as u8;
        (r, g, b)
    }
}

#[cfg(test)]
#[test]
fn test_rgb() {
    let pair = VimName { name: "snow", hex: 0xfffafa };
    let expected = (0xff, 0xfa, 0xfa);
    assert_eq!(pair.rgb(), expected);
}

