#[cfg(test)]
#[test]
fn assert_sorted() {
    for i in 0..NAMES.len() - 1 {
        let x = NAMES[i].name;
        let y = NAMES[i + 1].name;
        assert!(x < y, "not sorted: {x:?} > {y:?}");
    }
}
